#include <iostream>#include <vector>void print(std::vector<long long> readvec){    int sz = readvec.size();    for(int i = 0; i < sz; ++i){        std::cout << readvec.at(i);        if(sz - 1 != i){            std::cout << " ";        }else{            std::cout << std::endl;        }    }}int main(){    int n;    std::cin >> n;    std::vector<long long> a(n);    for(int i = 0; i < n; ++i){        std::cin >> a.at(i);    }    std::sort(a.begin(), a.end());    while(1 != a.size()){        long long min = *std::min_element(a.begin(), a.end());        for(auto itr = a.begin() + 1; a.end() != itr; ++itr){            *itr %= min;        }        std::sort(a.begin(), a.end());        a.erase(std::unique(a.begin(), a.end()), a.end());            print(a);    }    std::cout << *a.begin() << std::endl;    return 0;}